import logo from './logo.svg';
import './App.css';
import { Redirect } from '@reach/router';

function App() {
  return (
    <div className="App">
      <Router>
        <Main path="pirates/" />
        <Redirect
          from="/"
          to="/pirates"
          noThrow
        />
      </Router>

    </div>
  );
}

export default App;
